"   <div class=\"block phk drugH1Div\" id=\"F8012156\" xmlns=\"file://www.w3.org/1999/xhtml\">",
"    <span class=\"drugH1\">",
"     Pharmacodynamics/Kinetics",
"    </span>",
"    <p style=\"text-indent:-2em;margin-left:2em;text-align:justify;\">",
"     Onset of action: Response to treatment: May be seen within a few days; treatment for up to 6 weeks is often required",
"    </p>",
"    <p style=\"text-indent:-2em;margin-left:2em;text-align:justify;\">",
"     Half-life elimination: 80-90 minutes",
"    </p>",
"    <p style=\"text-indent:-2em;margin-left:2em;text-align:justify;\">",
"     Excretion: Urine and feces (equal amounts as unchanged drug); exhaled gases (small amounts)",
"    </p>",
"   </div>",
"  </div>",
