var title_f28_3_28730="TTTS2";
var content_f28_3_28730=[" <div id=\"graphicsToolbar\">",
"  <div id=\"graphicsCopy\">",
"   &copy;2013 UpToDate",
"   <sup>",
"    &reg;",
"   </sup>",
"  </div>",
"  <div id=\"graphicsLinks\">",
"   <a href=\"?imageKey=OBGYN%2F76957%7EOBGYN%2F52874%7EOBGYN%2F76546%7EOBGYN%2F54479%7EOBGYN%2F67334&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=3\" onclick=\"\">",
"    <img alt=\"Print this page\" src=\"./../images/icn_print.myextg\" title=\"Print this page\"/>",
"   </a>",
"   <a class=\"icontxt textLink\" href=\"?imageKey=OBGYN%2F76957%7EOBGYN%2F52874%7EOBGYN%2F76546%7EOBGYN%2F54479%7EOBGYN%2F67334&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=3\" onclick=\"\" title=\"Print this page\">",
"    Print",
"   </a>",
"   <a class=\"etacLink\" href=\"#\">",
"    <img alt=\"Email graphic(s)\" src=\"./../images/icn_email.myextg\" title=\"Email graphic(s)\"/>",
"   </a>",
"   <a class=\"icontxt textLink etacLink\" href=\"#\" title=\"Email graphic(s)\">",
"    Email",
"   </a>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\" style=\"width: 470px\">",
"   <div class=\"ttl\">",
"    TTTS2",
"   </div>",
"   <div class=\"cntnt\" style=\"width: 360px; height: 360px; background-image: url(data:image/jpeg;base64,);\">",
"   </div>",
"   <div class=\"lgnd\">",
"    Polyhydramnios in the recipient's sac with a deepest vertical pocket of 12.66 cm at approximately 22 weeks of gestation.",
"    <div class=\"footnotes\">",
"    </div>",
"    <div class=\"reference\">",
"     Courtesy of Kenneth J Moise, Jr, MD &amp; Anthony Johnson, DO.",
"    </div>",
"   </div>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\" style=\"width: 470px\">",
"   <div class=\"ttl\">",
"    TTTS3",
"   </div>",
"   <div class=\"cntnt\" style=\"width: 360px; height: 360px; background-image: url(data:image/jpeg;base64,);\">",
"   </div>",
"   <div class=\"lgnd\">",
"    Distended fetal bladder in the recipient fetus is noted at approximately 21.5 weeks of gestation.",
"    <div class=\"footnotes\">",
"    </div>",
"    <div class=\"reference\">",
"     Courtesy of Kenneth J Moise, Jr, MD &amp; Anthony Johnson, DO.",
"    </div>",
"   </div>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\" style=\"width: 470px\">",
"   <div class=\"ttl\">",
"    TTTS5",
"   </div>",
"   <div class=\"cntnt\" style=\"width: 360px; height: 360px; background-image: url(data:image/jpeg;base64,);\">",
"   </div>",
"   <div class=\"lgnd\">",
"    Sagittal view of the recipient twin at approximately 25 weeks of gestation. The fetal head is&nbsp;to the right and the fetal buttocks are&nbsp;to the left. Arrow&nbsp;points to&nbsp;fetal ascites indicating the presence of hydrops (Quintero Stage IV TTTS).",
"    <div class=\"footnotes\">",
"    </div>",
"    <div class=\"reference\">",
"     Courtesy of Kenneth J Moise, Jr, MD &amp; Anthony Johnson, DO.",
"    </div>",
"   </div>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\" style=\"width: 470px\">",
"   <div class=\"ttl\">",
"    TTTS6",
"   </div>",
"   <div class=\"cntnt\" style=\"width: 360px; height: 360px; background-image: url(data:image/jpeg;base64,);\">",
"   </div>",
"   <div class=\"lgnd\">",
"    Cross section of the fetal chest and heart of the recipient fetus at&nbsp;approximately 25&nbsp;weeks of gestation. Arrows point to the thickened myocardial walls of the fetal heart. The interventricular septum is also thickened.",
"    <div class=\"footnotes\">",
"    </div>",
"    <div class=\"reference\">",
"     Courtesy of Kenneth J Moise, Jr, MD &amp; Anthony Johnson, DO.",
"    </div>",
"   </div>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\" style=\"width: 470px\">",
"   <div class=\"ttl\">",
"    TTTS7",
"   </div>",
"   <div class=\"cntnt\" style=\"width: 432px; height: 313px; background-image: url(data:image/jpeg;base64,);\">",
"   </div>",
"   <div class=\"lgnd\">",
"    Doppler study of the fetal ductus venous in this recipient twin at&nbsp;approximately 25&nbsp;weeks of gestation. Fetal ascites&nbsp;can be&nbsp;noted in the top image.&nbsp;In the bottom image, the&nbsp;arrow points to the reversed \"a\" wave of the ductus venosus that occurs during diastole.",
"    <div class=\"footnotes\">",
"    </div>",
"    <div class=\"reference\">",
"     Courtesy of Kenneth J Moise, Jr, MD &amp; Anthony Johnson, DO.",
"    </div>",
"   </div>",
"  </div>",
" </div>",
"</div>"].join("\n");
